import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input to be available
    await page.waitForSelector('#searchInput');

    // Attempt XSS by injecting a script into the search input
    const xssPayload = '<script>alert("XSS Attempt")</script>';
    await page.fill('#searchInput', xssPayload);

    // Take a screenshot after filling the input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_input.png'));

    // Click the search button
    await page.click('.search-btn');

    // Wait for any potential result or alert
    await page.waitForTimeout(2000); // Adjust timeout as necessary

    // Take a final screenshot to capture the result
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_final_result.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_final_result.png'));

    return {
      success: true,
      action: "Attempted XSS via search input",
      extractedData: {
        inputValue: await page.inputValue('#searchInput')
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
